import React, { ReactNode } from 'react'
import styles from './Layout.module.css'
import { site } from './site.config'

export default function Layout({
  children,
  pageTitle = site.title
}: {
  children: ReactNode
  pageTitle?: string
}) {
  return (
    <div className={styles.app}>

      {children}

    </div>
  )
}
